async function ({url}, {h1}) {
  const browser = await puppeteer.launch();
  const page = await browser.newPage();
  await page.goto(url);
  const h1Tag = await page.$eval('h1', element => element.textContent);
  await browser.close();
  if (h1Tag) {
    h1.next(h1Tag);
  }
}
